function jsonConcat(o1, o2) {
	for ( var key in o2) {
		o1[key] = JSON.parse(JSON.stringify(o2[key]));
	}
	return o1;
};

var server = net.createServer(function(request, response) {
	//console.log('got ');
	console.log(request.method);

	if ( request.method == 'OPTIONS' ) {
		response.writeHead(200, {
			'Content-Length': -1,
			//'Content-Type': 'application/xml;charset=utf-8',
			'Access-Control-Allow-Credentials': 'true',
			'Access-Control-Allow-Origin': '*',
			'Access-Control-Allow-Headers': 'origin, content-type, accept',
			'Access-Control-Allow-Method': 'POST, GET, OPTIONS'
			,'Connection': 'close'
		});
		response.end();
		return;
	}


	if ( request.url == '/iware' ) {
		request.setEncoding('utf-8');
		request.on('data', function(chunk){
			console.log(chunk);

			var msg = JSON.parse(chunk);
			var type = null;
			for (var i in msg) {
				type = i;
				break;
			}
			
			var resp = JSON.parse(JSON.stringify(pairs[type]));
			if (type === 'xmlns.PatronInfoRequest') {
				var section = msg['xmlns.PatronInfoRequest']['xmlns.requestedSections'];
				if (section == 0) {
					var keys = Object.keys(patronInfo);
					for (var j=0 ; j<keys.length ; j++) {
						resp['xmlns.PatronInfoResponse'] = jsonConcat(resp['xmlns.PatronInfoResponse'], patronInfo[keys[j]]);
					}
				} else {
					resp['xmlns.PatronInfoResponse'] = jsonConcat(resp['xmlns.PatronInfoResponse'], patronInfo[section]);
				}
			} else if (type === 'xmlns.PatronImageRequest') {
				resp = patronImage[parseInt(msg['xmlns.PatronImageRequest']['xmlns.imageType'])];
			}
			
			console.log(JSON.stringify(resp));
			response.writeHead(200, {
				'Content-Length': -1,
				//'Content-Type': 'application/xml;charset=utf-8',
				'Access-Control-Allow-Credentials': 'true',
				'Access-Control-Allow-Origin': '*',
				'Access-Control-Allow-Headers': 'origin, content-type, accept',
				'Access-Control-Allow-Method': 'POST, GET, OPTIONS'
				,'Connection': 'close'
			});
			response.end(JSON.stringify(resp));
		});
	}
	else {
		response.statusCode = 404;
		response.end('Page Not Fount');
	}
});

server.listen(8124, function() { //'listening' listener
	console.log('iware bound');
});



